export function getTodos() {
  return fetch("http://5ce6afee0adb8e0014a6f307.mockapi.io/todos/todos").then(
    res => res.json(),
  );
}

export function createTodo(name) {
  fetch("https://5ce6afee0adb8e0014a6f307.mockapi.io/todos/todos", {
    method: "post",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: JSON.stringify({ name: name, complete: false }),
  }).then(res => res.json());
}
